import './App.css';
import { book } from './Book_1.js';

const words = book.content.split(' ');

let i = 0;

function increment(i) {
  sleep(50);
  return i++;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          { book.title }
        </p>
        <p>
          { words[increment(i)] }
        </p>
      </header>
    </div>
  );
}

export default App;
